create database if not exists lab3_schema;
use lab3_schema;

create table users (
	id INT unsigned not null primary key auto_increment,
	username VARCHAR(50),
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	pass VARCHAR(50),
	birthdate DATE
);

